import { styled } from 'styled-components';

export const Button = styled.button`
  background-color: #5b43d6;
  color: #fff;
  border-radius: 5px;
  width: 45.5%;
  height: 30px;
  display: flex;
  align-items: center;
  justify-content: center;
`;
